INSERT INTO `dylc2018_tutor` VALUES ('038fc08649bb3bed5b5bd28dcf0d14f0','罗城璧','勐海','勐海茶厂','3','论茶大赛第22名','暂无','453701772@qq.com','茶学专业毕业，扎实的茶学理论基础，普洱茶全方位品鉴，丰富的品茶经验','/2018/dylc/20180515/b7008a9a6dc621e7de7ebb58c3e2f78d.jpg','/2018/dylc/20180515/9750a5ff85539ba97e6fbde0e002c48a.jpg',63,'系统','admin',1526357924279,1526370421353,'1'),('04f35239e6147a22d8985fa8c55b1bf2','付荣群','北京','营销中心培训部','3','论茶大赛第26名','暂无','921777675@qq.com','2008年进入大益，培训经验丰富，理论知识扎实，熟悉掌握各系列茶品特点','/2018/dylc/20180515/3e46dcb6fce51a50f141de063804e049.jpg','/2018/dylc/20180515/69c723139f9eb50a5fd3523e08bf6251.jpg',36,'系统','admin',1526357924278,1526369147656,'1'),('089d6b72db30a888af94bf61c3607c5d','黄超','广东广州','广州市春光茶叶有限公司','3','论茶大赛第45名','暂无','315626070@qq.com','21年涉茶经历，从事六大茶类销售，经常组织茶山制茶学习，从销售、产品采购到销售管理培训','/2018/dylc/20180515/a88f18430d2a400ecff3767741bfa662.jpg','/2018/dylc/20180515/71f3b92b2f644020753caed2fbe075b4.jpg',8,'系统','admin',1526357924278,1526365960437,'1'),('0d63612571b9b40ecf44ea93e50d9fc7','业倩雯','云南玉溪、昆明','澄江海诚旅游发展有限公司','3','论茶大赛第17名','暂无','2497297150@qq.com','更擅长根据茶叶特点，水温，冲泡技巧取长补短，更熟悉滋味和香气品鉴，茶席鉴赏擅长跟据不同场景搭配得当','/2018/dylc/20180515/680df80725132057836857bea4954faa.jpg','/2018/dylc/20180515/25006b1162e7ff5259800246001c2bfe.jpg',16,'系统','admin',1526357924278,1526366981366,'1'),('14238ebc72ae054cbdc0862ac01b5b24','梁杏嘉','广西南宁','广西乐荼茶叶有限公司','3','论茶大赛第44名','事茶15年，于2011年后一直在大益体系里工作，在2017年大益论茶晋级赛中取得广州赛区第一名。','83383219@qq.com','2003年接触茶行业，擅长研究各大茶区的特色，根据茶叶特点、水温、冲泡技巧取长补短，熟悉滋味和香气品鉴','/2018/dylc/20180515/9a2d1332dbf5a9fa56559cda217fe825.jpg','/2018/dylc/20180515/95df268ecf38b14cd2036fd056cf90b4.jpg',21,'系统','admin',1526357924278,1526367372778,'1'),('14b560e1e4b7edb2fc7d023aff9113b7','马伟伟','勐海','勐海茶厂','3','论茶大赛第4名','暂无','460024837@qq.com','熟悉大益普洱茶拼配特性和品质特点，擅长根据学员特性提供专业的个性化品鉴技巧培训','/2018/dylc/20180515/4cc795ae48501fc2ad6a8d84f919ce8d.jpg','/2018/dylc/20180515/2ebfd42e01057f0960831b94ccd57959.jpg',66,'系统','admin',1526357924279,1526370291834,'1'),('1b436c576bcf87ac72cf41463ade5649','杨明辉','云南昆明','营销中心西南市场部'