DROP TABLE IF EXISTS `dylc2018_user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `dylc2018_user` (
  `id` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `uid` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '用户ID',
  `real_name` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '真实姓名',
  `idcard` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '身份证号',
  `organization` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '工作单位',
  `user_province_code` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '用户常驻 省份直辖市码',
  `user_province` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '用户常驻  省份直辖市',
  `user_city_code` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '用户常驻 城市码',
  `user_city` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '用户常驻 城市',
  `user_area_code` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '区域码',
  `user_area` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '区域',
  `user_address` varchar(200) COLLATE utf8_bin NOT NULL COMMENT '收货地址',
  `user_email` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '邮箱',
  `activity_city_code` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '参赛城市码',
  `activity_city` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '参赛城市',
  `mobile` varchar(20) COLLATE utf8_bin NOT NULL COMMENT '手机号',
  `img1` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '证书拍照',
  `img2` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '师徒契约照',
  `check_state` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '审核状态;0:未审核;1:审核通过;2:审核不通过',
  `check_remark` varchar(200) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '审核备注',
  `create_user` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人',
  `update_user` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '修改人',
  `create_time` bigint(15) unsigned NOT NULL COMMENT '新建时间',
  `update_time` bigint(15) unsigned DEFAULT NULL COMMENT '修改时间',
  `state` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '状态;0:无效;1:有效',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='用户相关信息';
/*!40101 SET character_set_client = @saved_cs_client */;

